      var panel = document.createElement('div');

      gd.parentElement.insertBefore(panel, gd);

      var slider = document.getElementById('cmp_triple_alpha');
      var aval   = document.getElementById('cmp_triple_aval');

      function setOpacity(val) {
        var v = Number(val);
        aval.textContent = v.toFixed(2);
        Plotly.restyle(gd, {'marker.opacity': [v, v, v]}, [0,1,2]);
      }
      slider.addEventListener('input', function() { setOpacity(this.value); });

      var syncing = false;
      gd.on('plotly_relayout', function(e) {
        if (syncing) return;
        var cam = e['scene.camera'] || e['scene2.camera'] || e['scene3.camera'];
        if (!cam) return;
        syncing = true;
        Plotly.relayout(gd, {
          'scene.camera': cam,
          'scene2.camera': cam,
          'scene3.camera': cam
        }).then(function() { syncing = false; });
      });
    })();
